import {
  Column,
  Entity,
  JoinColumn,
  ManyToOne,
  PrimaryGeneratedColumn,
} from 'typeorm';
import Category from './category';

export type TargetType = '_blank' | '';

const logoPlaceHolder =
  'data:image/png;base64,';

@Entity()
export default class Service {
  @PrimaryGeneratedColumn()
  id?: number;

  @Column({ nullable: false })
  name: string;

  @Column({ nullable: true })
  description?: string;

  @Column({ nullable: false, default: '#' })
  url?: string;

  @Column('simple-array')
  tags?: string[];

  @Column({
    nullable: false,
    type: 'text',
    default: '_blank',
  })
  target?: TargetType;

  @Column({ type: 'blob', nullable: false, default: logoPlaceHolder })
  logo?: string;

  @ManyToOne(() => Category)
  @JoinColumn({ referencedColumnName: 'id' })
  category: Category;
}
